import React, { useEffect, useState, useLayoutEffect } from 'react';
import { StyleSheet, Text, View, TouchableOpacity } from 'react-native';
import { Avatar, Icon, Image } from 'react-native-elements';

const ViewProyectScreen = ({ navigation, route }) => {
    const [item, setItem] = useState(null);
    useLayoutEffect(() => {
        navigation.setOptions({
            headerTitle: () => <Image
                source={{ uri: 'https://i.ibb.co/zHMVH1h/logo.png' }}
                style={{
                    width: 300, height: 50, display: 'flex', margin: 'auto'
                }}
            />,
            // title: 'SHOREBREAK ENERGY',
            headerStyle: {
                backgroundColor: '#fff',
                justifyContent: 'space-between'
                // alignItems: 'center',
                // justifyContent: 'center',
            },
            // headerTitleStyle: {
            //     color: 'black', textAlign: 'center',
            // },
            headerTitleColor: 'black',
            headerLeft: () => (
                <View style={{ paddingLeft: 10 }}>
                    <TouchableOpacity activeOpacity={0.5}>
                        {auth?.currentUser?.photoURL ?
                            <Avatar rounded source={{ uri: auth?.currentUser?.photoURL }} /> :
                            <Icon name='sign-out'
                                type='font-awesome'
                                color='red'
                            />}
                    </TouchableOpacity>
                </View>
            ),
            headerRight: () => (
                <View style={{
                    flexDirection: 'row',
                    justifyContent: 'flex-end',
                    width: 80,
                    textAlign: 'headerRight',
                    paddingRight: 10
                }}>
                    <TouchableOpacity onPress={() => navigation.navigate('NEW')} activeOpacity={0.5}>
                        <SimpleLineIcons name='pencil' size={24} color='black' />
                    </TouchableOpacity>
                </View>
            )
        });
    }, [navigation]);
    useEffect(() => {
        setItem(route.params.item);
    }, [])
    return (
        <View>
            <Text>{console.log(item)}</Text>
        </View>
    )
}

export default ViewProyectScreen

const styles = StyleSheet.create({})
